        Effect Example
      </div>
      <h1>{count}</h1>
      <button className="btn btn-primary m-1" onClick={Incrise}>
        pl
      </button>
      <button className="btn btn-primary m-1" onClick={Decrese}>
        -
      </button>
    </div>
  );
};

